import React from 'react'

const Error = () => {
    return (
        <>
            <div className="not-found">
               <h1 className="error"><span className="errorname">404</span> Page Not Found</h1>
               <div className="row">
                   <div className="col-3">
                       
                   </div>
               </div>
            </div>
        </>
    )
}

export default Error;
